import React from "react";

class Buttons9aaa extends React.Component {
  constructor(props) {
    super(props);
    this.state = { color: "----" };
  }
  changeColor = () => {
    let color = this.state.color;
    if (color == "----") {
      color = "xxxx";
    } else if (color == "xxxx") {
      color = "oooo";
    } else {
      color = "xxxx";
    }
  };
  render() {
    return (
      <>
        <button
          type="button"
          style={{
            backgroundColor: "red",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.changeColor}
        >
          <h3>{this.state.color}</h3>
        </button>
        <button
          style={{
            backgroundColor: "blue",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.blue}
        >
          Check I am blue!
        </button>
        <button
          style={{
            backgroundColor: "Yellow",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.yellow}
        >
          Check I am Yellow!
        </button>
        <button
          style={{
            backgroundColor: "purple",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.purple}
        >
          Check I am purple!
        </button>
        <button
          style={{
            backgroundColor: "pink",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.pink}
        >
          Check I am pink!
        </button>
        <button
          style={{
            backgroundColor: "orange",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.orange}
        >
          Check I am orange!
        </button>
        <button
          style={{
            backgroundColor: "lightblue",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.lightblue}
        >
          Check I am lighblue!
        </button>
        <button
          style={{
            backgroundColor: "grey",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.grey}
        >
          Check I am grey!
        </button>
        <button
          style={{
            backgroundColor: "white",
            width: "150px",
            height: "60px",
            margin: "20px",
          }}
          onClick={this.white}
        >
          Check I am white!
        </button>
      </>
    );
  }
}
export default Buttons9aaa;
